import React, { Component } from 'react';
import { Card, Container, Row, Table } from 'react-bootstrap';
import axios from 'axios';

class ListOrders extends Component {
    constructor(props) {
        super(props);
        this.state = {
            ListOrders: []
        }
    }

    componentDidMount() {
        axios.get(`http://localhost:8082/api/v1/orders/listorders/`, '').then(res => {
            if (res && res.data && res.data.success) {
                this.setState({ ListOrders: res.data.output });
                console.log("res", res.data.output);
            }
        })
    }

    render() {
        return (
            <Container fluid>
                <Card>
                    <Card.Body>
                        <Card.Title>List Orders</Card.Title>
                        <Row>
                            <Table striped hover size="sm">
                                <thead>
                                    <tr>
                                        <th><b>orderNumber</b></th>
                                        <th><b>orderDate</b></th>
                                        <th><b>customerId</b></th>
                                    </tr>
                                </thead>
                                <tbody>
                                    {this.state.ListOrders.map((prop) => {
                                        return <tr>
                                            <td>{prop["orderNumber"]}</td>
                                            <td>{prop["orderDate"]}</td>
                                            <td>{prop["customerId"]}</td>
                                        </tr>
                                    })}
                                </tbody>
                            </Table>
                        </Row>
                    </Card.Body>
                </Card>
            </Container>
        )
    }
}

export default ListOrders;
